import classNames from "classnames";
import React from "react";
import "./NavBarItem.css"

export interface NavBarItemProps {
	label: string;
	icon: string;
	active: boolean;
}

class NavBarItem extends React.Component<NavBarItemProps, {}> {
	render() {
		return (
			<div className={classNames("NavBarItem", { "active": this.props.active })}>
				<img src={this.props.icon} alt="" className="NavBarItem__Icon" />
				<div className="NavBarItem__Label">{this.props.label}</div>
			</div>
		);
	}
}

export default NavBarItem;
